import{_ as e,o as t,c as r,O as a}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 33.2-3601 Interstate 81 Corridor Improvement Fund.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/33.2-3601.md","filePath":"vacode/33.2-3601.md"}'),n={name:"vacode/33.2-3601.md"},o=a('<h1 id="§-33-2-3601-interstate-81-corridor-improvement-fund" tabindex="-1">§ 33.2-3601 Interstate 81 Corridor Improvement Fund. <a class="header-anchor" href="#§-33-2-3601-interstate-81-corridor-improvement-fund" aria-label="Permalink to &quot;§ 33.2-3601 Interstate 81 Corridor Improvement Fund.&quot;">​</a></h1><p>A. There is hereby created in the state treasury a special nonreverting fund to be known as the Interstate 81 Corridor Improvement Fund. The Fund shall be established on the books of the Comptroller. All revenues dedicated to the Fund pursuant to §§ <a href="/vacode/33.2-372/">33.2-372</a> and <a href="/vacode/58.1-2299.20/">58.1-2299.20</a>, any other funds that may be appropriated by the General Assembly, and any funds that may be received for credit to the Fund from any other sources shall be paid into the state treasury and credited to the Fund. Interest earned on moneys in the Fund shall remain in the Fund and be credited to it. Any moneys remaining in the Fund, including interest thereon, at the end of each fiscal year shall not revert to the general fund but shall remain in the Fund.</p><p>B. Moneys in the Fund shall be used only for capital, operating, and other improvement costs identified in the Plan.</p><p>C. The amounts deposited into the Fund and the distribution and expenditure of such amounts shall not be used to calculate or reduce the share of federal, state, or local revenues otherwise available to jurisdictions along the Interstate 81 corridor. Further, such revenues and moneys shall not be included in any computation of, or formula for, a locality&#39;s ability to pay for public education, upon which appropriations of state revenues to local governments for public education are determined.</p><p>2019, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0837" target="_blank" rel="noreferrer">837</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0846" target="_blank" rel="noreferrer">846</a>; 2020, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP1230" target="_blank" rel="noreferrer">1230</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP1275" target="_blank" rel="noreferrer">1275</a>.</p>',5),i=[o];function d(s,l,h,c,u,p){return t(),r("div",null,i)}const _=e(n,[["render",d]]);export{m as __pageData,_ as default};
